# Returns a clean Text
def clean_text(text):
    if type(text)!=type(''):
        raise TypeError("Argument must be a string")
    else:
        strDelete = '''।,.?!…:;@#$^&*(){}[]'"‘’“”-_'''
        table = text.maketrans('\t\n', '  ', strDelete)
        text = text.translate(table)
        test = re.sub('\s\s+', ' ', text) # Remove multiple space
        text = text.strip()
        return text
        

# Returns a list of Words
def word_tokenize(sentence):
    if type(sentence)!=type(''):
        raise TypeError("Argument must be a string")
    else:
        sentence = clean_text(sentence) 
        return sentence.split()


# Returns a list of Sentences
def sent_tokenize(paragraph):
    if type(paragraph)!=type(''):
        raise TypeError("Argument must be a string")
    else:                    
        strDelete = ''',.…:;@#$^&*(){}[]'"‘’“”-_'''
        table = paragraph.maketrans('\t\n', '  ', strDelete)
        paragraph = paragraph.translate(table)        
        paragraph = re.sub('\s\s+', ' ', paragraph)
        paragraph = paragraph.strip(' ।?!')
        paragraph = re.split(r'[।?!]\s*', paragraph)
        
        return list(filter(None, paragraph))     


# Returns POS tag of a word 
def pos_tag(word):
    if type(word)!=type(''):
        raise TypeError("Argument must be a string")
    else:   
        try:
            word = word.strip()
            if word[0] in ['১','২','৩','৪','৫','৬','৭','৮','৯','০']:
                return 'CD'
            else:
                w = get_close_matches(word, dictPos.keys(), n=1, cutoff=0.6)
                if w == []:
                    return 'UNK'
                else:
                    return dictPos[w[0]]
        except:
            return 'UNK'


# Returns Synonym of a word 
def synonym(word):
    if type(word)!=type(''):
        raise TypeError("Argument must be a string")
    else:   
        for s in listSyn:
            if word in s:
                return s
        return [word]
    

