def stemmer(word):
    if type(word)!=type(''):
        raise TypeError("Argument must be a string")
    else:
        word = word.strip()
        pos = pos_tag(word)
        
        if pos in ['PR','PRP']:
            for i in pronoun_dict.items():
                if word in i[-1]:
                    return i[0]

        elif pos in ['NN','NNS','NNP','NNPS','NNV']:    
            for i in noun_suffix:
                if word.endswith(i):
                    return word[:-len(i)]

        elif pos in ['RB','RBR','RBS','VB','VBD','VBG','VBN','VBP','VBZ']:
            for i in verb_suffix:
                if word.endswith(i):
                    return word[:-len(i)]
                    
        elif pos in ['JJ','JJR','JJS','']:
            for i in adjective_suffix:
                if word.endswith(i):
                    return word[:-len(i)]
                    
        else:
            pass
        return word

